import { Menu } from "antd";
import SubMenu from "antd/lib/menu/SubMenu";
import { Link } from "react-router-dom";

export function Submenu(id: string) {
  const category_subcategory: object = {
    appliance: {
      category: "appliance",
      subcategory: {
        vacuum: "vacuum",
        coffeepots: "coffee pots",
        toaster: "toaster",
        blenders: "blenders",
      },
    },
    clothing: {
      category: "clothing",
      subcategory: {
        clothes: "clothes",
        purse: "purse",
        shoes: "shoes",
        fitting: "fitting clothes",
      },
    },
    photovideo: {
      category: "photo/video",
      subcategory: {
        cameras: "cameras",
        fitting: "fitting video",
        telecamera: "telecamera",
        microphones: "microphones",
      },
    },
    hobby: {
      category: "hobby",
      subcategory: {
        toys: "toys",
        filmdvd: "films/dvds",
        music: "music",
        books: "books/magazines",
      },
    },
  };
  if (id === "appliance") {
    return (
      <SubMenu key="app" className="submenu-active" title="Appliance">
        <Menu.Item key="vacuum">
          <Link to="/appliance/vacum" className="link-submenu">
            vacuum
          </Link>{" "}
        </Menu.Item>
        <Menu.Item key="coffee">coffee pots</Menu.Item>
        <Menu.Item key="toaster">toaster</Menu.Item>
        <Menu.Item key="blenders">blenders</Menu.Item>
      </SubMenu>
    );
  }
  for (const [key, vaule] of Object.entries(category_subcategory)) {
    console.log(key, vaule);
  }
}
